import React, { Component } from "react";

export default class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      logged: false
    }
  }

  render() {
    return (
      <div className="App">
      {
        this.state.logged ? <h1>Logado</h1> : <h1>Deslogado</h1>
      }
      </div>
    );
  }
}
